branchCategory.description:
&lt;p&gt;
The CL1 series lock-up cylinder is a self-locking style that contains a ring that is tilted by a spring force, which is further tilted by the load that is applied to the cylinder, thus locking the piston rod. This cylinder is suitable for intermediate stops, emergency stops, or for drop prevention.
&lt;/p&gt;

